import Card from "react-bootstrap/Card";
import MenuOption from "./MenuOption";

const Menu = (props) => {
  
    const menuItems = [
        {
            foodName: 'Sushi',
            description: 'Finest fish and veggies',
            price: 22.99
        },
        {
            foodName: 'Schnitzel',
            description: 'A german specialty!',
            price: 16.50
        },
        {
            foodName: 'Adana Kebap',
            description: 'Efsane Adana Kebap',
            price: 18.00
        }
    ]

return (
    <Card
      style={{
        width: "800px",
        height: "300px",
        margin: "auto",
        marginTop: "50px",
        marginBottom: "50px",
        backgroundColor: "#ccc",
      }}
    >
      <MenuOption></MenuOption>
    </Card>
  );
};

export default Menu;
